import React from "react";

const musicProjects = [
  {
    artist: "Oyan (Band)",
    title: "Single - Wooyadongdong",
    description: "Energetic grungy track from the trio band Oyan.",
    status: "Released"
  },
  {
    artist: "Oyan (Band)",
    title: "Album - ??",
    description: "1st full-length album in progress.",
    status: "In Progress"
  },
  {
    artist: "Nam Heeon (Solo)",
    title: "EP - Psychedelic Disco: A Flowing Life",
    description: "Solo project experimenting with disco and psychedelic rock.",
    status: "Released"
  },
  {
    artist: "Nam Heeon (Solo)",
    title: "Album - Freedom",
    description: "1st full-length solo album in progress, exploring themes of liberation.",
    status: "In Progress"
  },
  {
    artist: "New Band (Planned)",
    title: "Upcoming Project",
    description: "Exploring new collaborations with members from engineering club band.",
    status: "Planning"
  }
];

export default function Music() {
  return (
    <div className="px-6 py-12 max-w-4xl mx-auto">
      <h2 className="text-3xl font-bold tracking-tight mb-8 text-center uppercase">Music Projects</h2>
      <div className="space-y-4">
        {musicProjects.map((project, index) => (
          <div key={index} className="border rounded-xl p-4 hover:shadow-md transition bg-white/70 backdrop-blur-sm">
            <p className="text-sm text-gray-600">{project.artist}</p>
            <p className="text-base font-medium mt-1">{project.title}</p>
            <p className="text-sm mt-1 text-gray-700">{project.description}</p>
            <p className="text-xs mt-2 text-right text-indigo-500 font-semibold">{project.status}</p>
          </div>
        ))}
      </div>
      <div className="mt-10 text-center">
        <p className="text-sm text-gray-500">Genre: <span className="font-semibold text-gray-700">Disco, Psychedelic, Garage Rock</span></p>
      </div>
    </div>
  );
}
